'''
给定一个字符串 s 和一些长度相同的单词 words。找出 s 中恰好可以由 words 中所有单词串联形成的子串的起始位置。
注意子串要与 words 中的单词完全匹配，中间不能有其他字符，但不需要考虑 words 中单词串联的顺序。

示例 1：
输入：
  s = "barfoothefoobarman",
  words = ["foo","bar"]
输出：[0,9]
解释：
从索引 0 和 9 开始的子串分别是 "barfoo" 和 "foobar" 。
输出的顺序不重要, [9,0] 也是有效答案。
示例 2：

输入：
  s = "wordgoodgoodgoodbestword",
  words = ["word","good","best","word"]
输出：[]
'''
class Solution:
    def findSubstring(self, s: str, words):
        ret = []
        if len(words) == 0:
            return ret
        slen = len(words)
        tlen = slen * len(words[0])
        wlen = len(words[0])
        if len(s) < tlen:
            return ret
        wordsd = dict()
        for word in words:
            if wordsd.keys().__contains__(word):
                wordsd[word] += 1
            else:
                wordsd[word] = 1
                
        for i in range(len(s)):
            if len(s) - i < tlen:
                return ret
            temp_wordsd = wordsd.copy()
            for j in range(slen):
                temps = s[i + wlen * j: i + wlen * (j + 1)]
                if temp_wordsd.keys().__contains__(temps):
                    temp_wordsd[temps] -= 1
                    if temp_wordsd[temps] == 0:
                        temp_wordsd.pop(temps)
                else:
                    break
            if temp_wordsd.keys().__len__() == 0:
                ret.append(i)
        return ret

